                    title21: "Why does the orginal BL still appear after the SEAWAY Bill was submitted?",
                    answer21: "Please select the SWB checkbox when submitting the SI.",
                    title22: "How can I obtain an account statement?",
                    answer22: "Please contact Customer Service.",
                    title23: "How can I download a Booking Request?",
                    answer23: "The website does not provide a BR download function, but if you fill in a valid email address during your booking submission, you will receive the BR copy after booking confirmation."
